package com.servinglynk.hmis.warehouse.service.exception;@SuppressWarnings("serial")public class SessionNotFoundException extends RuntimeException {	/**	 * 	 * Default exception message	 */	public static final String DEFAULT_MESSAGE = "session not found";	public SessionNotFoundException() {		super(DEFAULT_MESSAGE);	}	public SessionNotFoundException(String message) {		super(message);	}	public SessionNotFoundException(Throwable cause) {		super(DEFAULT_MESSAGE, cause);	}	public SessionNotFoundException(String message, Throwable cause) {		super(message, cause);	}}